SimMission.ScriptAction.Script:
!lua
-- QUESTION1 script
local lvars = {
    ['_continue'] = 0;
    ['_state'] = 0;
    ['_options'] = 9;
    ['_level'] = 1;
    ['_gate'] = 0;
    ['_hit'] = 0;
    ['_ui_focus_id'] = (10*100);
    ['_last_poll'] = 0;
}
function state2()
    for lvar, default in pairs(lvars) do
        varset('L:'..lvar, default)
    end
    for i=0, 15, 1 do
        varset('L:_toggle'..i, 0)
    end
end

state2()

