SimMission.ScriptTrigger.Script:
!lua
-- INIT script
local lvars = {
    ['_continue'] = 0;
    ['_state'] = 1;
    ['_options'] = 0;
    ['_level'] = 0;
    ['_gate'] = 0;
    ['_hit'] = 0;
    ['_ui_focus_id'] = (3*200) -1;
    ['_last_poll'] = 0;
}
function init()
    for lvar, default in pairs(lvars) do
        varset('L:'..lvar, default)
    end
    for i=0, 15, 1 do
        varset('L:_toggle'..i, 0)
    end
    varset('L:_toggle0', 1)
end

init()
return true
